n is a fair fashion brand from Amsterdam and their designs are all vintage inspired fits and patterns. Already founded in the 80s, selling vintage clothing on markets, we share the same love for those past times and designs. Even though the brand exists over 35 years already they still put much effort into evolving as a brand and be conscious about their actions and influence. They are part of the fair wear foundation, super transparent about their suppliers and increase the amount of sustainable fabrics in every new collection. I was able to style multiple vintage inspired looks for them and shot them on film together with my girl @gloria_philomena and Fussel of course. We had so much fun creating these and I hope you love them too. #kinglouiebyme #myKLfashiontwist"}}]},"edge_media_to_comment":{"count":79},"comments_disabled":false,"taken_at_timestamp":1616694105,"edge_liked_by":{"count":13387},"edge_media_preview_like":{"count":13387},"location":{"id":"115735848437200","has_public_page":true,"name":"Cologne, Germany","slug":"cologne-germany"},"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.178.1440.1440a/s640x640/165270873_2451804418298146_3770114038906389699_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=hfiLpSmRMPYAX-pF1vP\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=17320c6b15838f06c4e3bbfbfd00719a\u0026oe=6092D36C\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.178.1440.1440a/s150x150/165270873_2451804418298146_3770114038906389699_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=hfiLpSmRMPYAX-pF1vP\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=f83def9466eaf6156f8578ed02c0d6a9\u0026oe=60954945\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.178.1440.1440a/s240x240/165270873_2451804418298146_3770114038906389699_n. ull},"media_overlay_info":null,"media_preview":"ACEqyfLFXoYINuJCAx/2sY/z70wL6VG9sVJ4Bz+mamcW1o2vQinq9dRjRbSR6GlCVaaExADt2NNxVrzIejK22irW2imK4sX3gfSrboH5JIzWcCfzqxHcOeCFP4H/ABotc0i0ttySRyRj+6eM9+P51Cw//V6UkhLH5uTUDAhwVGcjB+lLbUG1LQsUUzNFUZCRLk5PQUiY8winp9z86ZF1/OqKRJJ60wGnSVEKlksM0U6igR//2Q==","owner":{"id":"197367138","username":"nanda_schwarz"},"is_video":false,"accessibility_caption":"Photo shared by Nanda Weskott on March 15, 2021 tagging @zalando, and @levis_germany. May be an image of 1 person and standing."}}]}}},{"node":{"__typename":"GraphImage","id":"2528692280241924427","shortcode":"CMXuDs2F6lL","dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p1080x1080/160258543_149993603644868_2377067476107814616_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=6Uvz-lrFtbsAX99aJVJ\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=9dac8ba7bd59e9e15363652dd471cdd7\u0026oe=60956171\u0026_nc_sid=7bff83","edge_media_to_tagged_user":{"edges":[]},"fact_check_overall_rating":null,"fact_check_information":null,"gating_info":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"media_overlay_info":null,"media_preview":"ACEqzNjE4PH1prxFDg1a3A09RuGCM0XKKG2mla0WtT1HSq7xletPR7C1W5WxRUu2imBOq4qZXxTAKkC1LQXJPNpNyH7wpAtIRmlZId2xuI/Q/nRRs/z/AJNFGncWvYQU8HsP5VWZiO9Qlj6mk2NIts+OATVdpiahY1GaBk3mGioaKBH/2Q==","owner":{"id":"197367138","username":"nanda_schwarz"},"is_video":false,"accessibility_caption":"Photo by Nanda Weskott on March 13, 2021. May be an image of cloud and nature.","edge_media_to_caption":{"edges":[{"node":{"text":"\u26c5\ufe0f Mir ist aufgefallen, dass mich meist die gleichen kleinen Dinge glu\u0308cklich machen. Auch wenn ich sie immer wieder tue oder erlebe, verfehlen sie ihre Wirkung nicht. Ist das nicht scho\u0308n? Dass wir uns auf die gleichen Sachen immer wieder freuen ko\u0308nnen? Das ist u\u0308berhaupt nicht langweilig oder einto\u0308nig, das ist beruhigend und zeigt, dass man nicht jeden Tag etwas anderes tun oder erleben muss um sich erfu\u0308llt zu fu\u0308hlen. Fu\u0308r mich sind es: Matcha am Morgen, gutes Essen und YouTube gucken, Spazierga\u0308nge mit Fussel oder ein tolles Fotomotiv entdecken. \n\nI've noticed that mostly the same little things make me happy. Even if I do or experience them again and again, they do not fail to have an effect. Isn't that nice? That we can look forward to the same things over and over again? It's not boring or monotonous at all, it's comforting and shows that you don't have to do or experience something different every day in order to be fulfilled. For me it is: Matcha in the morning, good food and watching YouTube, walks with Fussel or discovering a great photo motif."}}]},"edge_media_to_comment":{"count":23},"comments_disabled":false,"taken_at_timestamp":1615663631,"edge_liked_by":{"count":5133},"edge_media_preview_like":{"count":5133},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/160258543_149993603644868_2377067476107814616_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=6Uvz-lrFtbsAX99aJVJ\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=5059dc44c9e1bcbc8b2171fd037c25a5\u0026oe=6094A915\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/160258543_149993603644868_2377067476107814616_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=6Uvz-lrFtbsAX99aJVJ\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=59f7f680f9a841e76b5e9faf9b1e7c30\u0026oe=6092F7E5\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s240x240/160258543_149993603644868_2377067476107814616_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc _pic_url":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-19/s150x150/154095547_255582179392663_8444255049116057979_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_ohc=BIBaOlRbinsAX8s6qmf\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=f4e4f7c4a1aee560a04bb573baf74a4b\u0026oe=60925FC1\u0026_nc_sid=7bff83","username":"kaufdichgluecklich"},"x":0.5982222087,"y":0.5288888753}}]},"fact_check_overall_rating":null,"fact_check_information":null,"gating_info":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"media_overlay_info":null,"media_preview":null,"owner":{"id":"197367138","username":"nanda_schwarz"},"is_video":false,"accessibility_caption":"Photo shared by Nanda Weskott on March 12, 2021 tagging @kaufdichgluecklich. May be an image of one or more people, people standing, outdoors and brick wall.","edge_media_to_caption":{"edges":[{"node":{"text":"Werbung \ud83d\udc25 this was a comfortable and colorful home office look from @kaufdichgluecklich - I once designed one of my very first collections with them, that\u2019s already so long ago again. Honestly I never ever in my dreams though I would get the chance to work with brands I loved or ever make a penny with photography and fashion. It still blows my mind sometimes but at the same time feels normal to me as it developed over almost a decade. I still often think about what my future is this business will look like. I for sure think I can\u2019t do this all my life but oh I will enjoy it as long as it will be fun and as long as you are interested in my stuff \ud83d\ude02 but I plan on finishing my studies, I kind of decided on that even though they aren\u2019t my \u201edream studies\u201c. And for the other part of my future I will just take it easy, who knows what will come my way. Never thought I would actually loose some of my future angst and let go of some worries, but here I am, 25 and it does get better every year."}}]},"edge_media_to_comment":{"count":37}," ck_information":null,"gating_info":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"media_overlay_info":null,"media_preview":null,"owner":{"id":"197367138","username":"nanda_schwarz"},"is_video":false,"accessibility_caption":"Photo by Nanda Weskott on March 11, 2021. May be an image of food.","edge_media_to_caption":{"edges":[{"node":{"text":"English below \ud83e\udd56\ud83e\uddc8\ud83e\udd5e\ud83c\udf73\ud83c\udf76\u2615\ufe0f\ud83e\uded6\ud83c\udf74In den letzen Tagen habe ich mich mal wieder ein bisschen ins Selbstmitleid abgleiten lassen. Waren einfach so Tage, negative Gedanken und so, ich will das gar nicht ausfu\u0308hren, wir kennen es alle denke ich. Habe schon immer mit vielen Zweifeln zu ka\u0308mpfen, schon als Kind brauchte ich immer die Besta\u0308tigung, dass das was ich mache richtig oder gut ist, aber irgendwie hat mir die dann auch nicht geholfen. Ablenkung hilft wirklich am besten an solchen Tagen, sich aus was ganz anderes einlassen. Auch irgendwie die Erfahrung, dass solche Tage und die Einstellung zu sich selbst meist schnell wieder vergehen. Heute geht\u2019s mir schon viel besser, ich habe einen doppelten Regenbogen gesehen, zum ersten Mal, 100 Fotos davon gemacht und weil Fussel so glu\u0308cklich war, bin ich es auch gewesen. Eben sa\u00df ich ganz zufrieden im Sessel meines Freundes und habe den Salat von gestern Abend gegessen. Ich wu\u0308nsche euch einen scho\u0308nen Tag und viele weitere davon und ganz viele Gute fu\u0308r jeden Schlechten den ihr vielleicht habt. \u2665\ufe0f\n\nIn the last few days I've let myself slide a little into self-pity. Just these days, negative thoughts and so on, I don't even want to go into that, we all know it, I think. I've always struggled with a lot of doubts, even as a child I always needed confirmation that what I was doing was right or good, but somehow that didn't help me either. Distraction really helps best on days like this, getting involved in something completely different. Also somehow the experience that such days and the attitude towards myself usually pass quickly. Today I'm much better, I saw a double rainbow, for the first time, took 100 photos of it and because Fussel was so happy, I was too. Then I was just sitting in my boyfriends armchair, completely satisfied, and ate last night's salad. I wish you a nice day and many more and many good ones for every bad one you might have \u2665\ufe0f\n\nThis was painted/inspired after an Artwork of Daniel Spoerri"}}]},"edge_media_to_comment":{"count":26},"comments_disabled":false,"taken_at_timestamp":1615483872,"edge_liked_by":{"count":4405},"edge_media_preview_like":{"count":4405},"location":{"id":"115735848437200","has_public_page":true,"name":"Cologne, Germany","slug":"cologne-germany"},"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/158427715_166341168520256_5109855352638546793_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=jxOWT_fObIUAX9wl1oy\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=f5fda89205db2f587ec6afbd78b9aef4\u0026oe=609422F3\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/158427715_166341168520256_5109855352638546793_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=jxOWT_fObIUAX9wl1oy\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=93a7351e60d8afe873d707aea110ed63\u0026oe=60958403\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s240x240/158427715_166341168520256_5109855352638546793_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=jxOWT_fObIUAX9wl1oy\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=4de361c221bf58fea0b9cd325926dafb\u0026oe=609585C5\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src"
